#1.2จงหาช่วงความเชื่อมั่นขนาด 90% ของผลต่างระหว่างอายุเฉลี่ยของผู้ป่วยชายและหญิง และสรุปว่า ผู้ป่วยที่เป็นโรคเบาหวาน ซึ่งเข้ามารับการรักษาพยาบาลที่โรงพยาบาลแห่งนี้ เพศใดมีอายุมากกว่าเพศใด และมากกว่ากี่ปี ถึงกี่ปี
from scipy.stats import t,sem
from statistics import  mean
import numpy as np

x1=np.array([45,52,45,48,56,54,58,65,55,60])
x2=np.array([60,62,65,45,56,68,57,64,63,55])
confidence_level = 0.90
df = len(x1)-1
sam_mean = np.mean(x1-x2)
std = sem(x1-x2)
print(t.ppf(confidence_level,df,sam_mean,std))
confidence_interval = t.interval(confidence_level,df,sam_mean,std)
print(confidence_interval)

"""1.2ตอบ ช่วงความเชื่อมั่น 90%ของผลต่างอายุเฉลี่ยผู้ป่วยชายและหญิง มีค่า -10.798046395881402 ถึง-0.6019536041185987 หมายความว่า ผู้หญิงมีอายุมากกว่าผุ้ชาย 0.6-10.8 ปี"""

