#2.3จะสรุปได้หรือไม่ว่ายาลดความดันมีประสิทธิภาพ (สามารถลดความดันได้จริง)
from scipy.stats import t,ttest_rel
import numpy as np
x1=np.array([175,179,165,170,160,180,177,178,173])
